import {Link} from "react-router-dom";

function MainNavigation(){
    return(
        <header>
            <ul>
                <li>
                    <Link to="/">All MeetUps</Link>
                </li>
                <li>
                    <Link to="new">New MeetUps</Link>
                </li>
                <li>
                    <Link to="fav">Favorites</Link>
                </li>

            </ul>
        </header>
    )

}

export default MainNavigation;
